import React from "react";
import "./CustomNav.scss";

const CustomNav = () => {
  return (
    <div className="custom-nav">
      <nav>
        <div className="icon">
          <div className="hamburger" />
        </div>
        <ul>
          <li>
            <a className="active" href="#home">
              Home
            </a>
          </li>
          <li>
            <a href="#news">News</a>
          </li>
          <li>
            <a href="#contact">Contact</a>
          </li>
          <li>
            <a href="#about">About</a>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default CustomNav;
